public class AppOtherDepartment implements Serializable {

	/**
	 * 
	 */
	private static final long serialVersionUID = -3692601891995330270L;

	public AppOtherDepartment() {
		// TODO Auto-generated constructor stub
	}
	
	private String id;
	
	private String physicCode;
	
	private String physicIals;
	
	private String name;
	
	private String isHave; //1有2无
	
	private String createUserId;
	
	private Date createDate;
	
	private String demo;
	
	private String status;

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public String getPhysicCode() {
		return physicCode;
	}

	public void setPhysicCode(String physicCode) {
		this.physicCode = physicCode;
	}

	public String getPhysicIals() {
		return physicIals;
	}

	public void setPhysicIals(String physicIals) {
		this.physicIals = physicIals;
	}

	public String getName() {
		return name;
	}

	public void setName(String name) {
		this.name = name;
	}

	public String getIsHave() {
		return isHave;
	}

	public void setIsHave(String isHave) {
		this.isHave = isHave;
	}

	public String getCreateUserId() {
		return createUserId;
	}

	public void setCreateUserId(String createUserId) {
		this.createUserId = createUserId;
	}

	public String getDemo() {
		return demo;
	}

	public void setDemo(String demo) {
		this.demo = demo;
	}

	public String getStatus() {
		return status;
	}

	public void setStatus(String status) {
		this.status = status;
	}

	public static long getSerialversionuid() {
		return serialVersionUID;
	}

	public Date getCreateDate() {
		return createDate;
	}

	public void setCreateDate(Date createDate) {
		this.createDate = createDate;
	}
	
	

}
